import streamlit as st
import os
import pandas as pd

# Load the CSV file if it doesn't already exist
if not os.path.exists('indian_food.csv'):
    # Assuming df is defined with the necessary data beforehand
    df.to_csv('indian_food.csv', index=False)

def show_page(page_name):
    if page_name == "main_page":
        main_page()

def main_page():
    col1, col2 = st.columns([1, 2])
    
    with col1:
        st.image("data:image/png;base64,", width=700, channels="RGB")
    with col2:
        st.write("")
    

    st.write("**Fill the Information**")

    ingredients = st.text_input("Enter Ingredients")

    # Diet selection
    st.write("**Please select your Diet:**")
    diet_veg = st.checkbox("Vegetarian")
    diet_non_veg = st.checkbox("Non Vegetarian")

    # Meal type selection
    st.write("**Please select your Meal Type:**")
    dessert = st.checkbox("Dessert")
    main_course = st.checkbox("Main Course")
    starter = st.checkbox("Starter")
    snack = st.checkbox("Snack")

    if st.button("Search"):
        if ingredients:
            df = pd.read_csv("indian_food.csv")
            
            # Filter based on ingredients
            filtered_df = df[df['ingredients'].str.contains(ingredients, case=False, na=False)]
            
            # Apply diet filtering
            if diet_veg and not diet_non_veg:
                filtered_df = filtered_df[filtered_df['diet'] == 'vegetarian']
            elif diet_non_veg and not diet_veg:
                filtered_df = filtered_df[filtered_df['diet'] == 'non vegetarian']
            
            # Apply meal type filtering
            meal_types = []
            if dessert:
                meal_types.append("dessert")
            if main_course:
                meal_types.append("main course")
            if starter:
                meal_types.append("starter")
            if snack:
                meal_types.append("snack")
            
            if meal_types:
                filtered_df = filtered_df[filtered_df['course'].isin(meal_types)]

            # Display results as styled cards
            if not filtered_df.empty:
                st.write("### Dishes that match your criteria:")
                
                for _, row in filtered_df.iterrows():
                    with st.container():
                        # Layout for each dish as a "card"
                        col1, col2 = st.columns([1, 4])
                        
                        # Optional: Display image if available
                        # col1.image(row['image_url'], width=100) if 'image_url' in row else None
                        
                        with col2:
                            # Dish name larger and bold
                            st.markdown(f"<h2 style='color:#ff6347;'>{row['name']}</h2>", unsafe_allow_html=True)  
                            st.write(f"**Diet**: {row['diet']}")
                            st.write(f"**Course**: {row['course']}")
                            st.write(f"**Ingredients**: {row['ingredients']}")
                            st.write(f"**Preparation Time**: {row.get('prep_time', 'N/A')} minutes")
                            st.write(f"**Cooking Time**: {row.get('cook_time', 'N/A')} minutes")
                            st.write(f"**Flavor Profile**: {row.get('flavor_profile', 'N/A')}")
                            st.write(f"**Region**: {row.get('region', 'N/A')}")
                            st.write(f"**Dish Type**: {row.get('course', 'N/A')}")
                            st.markdown("<hr>", unsafe_allow_html=True)  # Divider line for each card
            else:
                st.write("No Dishes Match.")

if 'page' not in st.session_state:
    st.session_state.page = "main_page"

# Show the appropriate page
show_page(st.session_state.page)
